import React from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import Card from "./Card";
import Sdata from "./Sdata";

const App = () => {
  return (
    <>
      <div className="">
        <div className="">
          <div className="">
            <div className="">
              {Sdata.map((val, ind) => {
                return (
                  <Card
                    key={ind}
                    title={val.title}
                    imgsrc={val.imgsrc}
                    note={val.note}
                    link={val.link}
                  />
                );
              })}
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default App;
